import React from "react";

import { Navbar } from "./components";
import "./App.css";

const App = () => {
  return (
    <div className="App">
      <Navbar />
      <Header />
      <Whatmedical />
      <Extra />
      <Services />
      <About />
      <Doctors />
      <Footer />
    </div>
  );
};

export default App;
